import React from 'react';
import './App.css';
import {BrowserRouter as Router, Switch, Route}  from "react-router-dom";
import Home from './components/home/Home';
function App() {
  return (
    <Router>
      <Switch>
      <Route path="/">
            <Home/>
          </Route>
      </Switch>
    </Router>
  );
}

export default App;
